import ReactTables from "views/Tables/ReactTables.js";

// @material-ui/icons
import Lock from "@material-ui/icons/Lock";

let dashRoutes = [
  {
    collapse: true,
    name: "Seguridad",
    icon: Lock,
    state: "pageCollapse",
    views: [
      {
        path: "/react-tables",
        name: "React Tables",
        rtlName: "رد فعل الطاولة",
        mini: "◦",
        rtlMini: "در",
        component: ReactTables,
        layout: "/admin"
      },
      {
        path: "/react-tables",
        name: "React Tables",
        rtlName: "رد فعل الطاولة",
        mini: "◦",
        rtlMini: "در",
        component: ReactTables,
        layout: "/admin"
      },
      {
        path: "/react-tables",
        name: "React Tables",
        rtlName: "رد فعل الطاولة",
        mini: "◦",
        rtlMini: "در",
        component: ReactTables,
        layout: "/admin"
      }
    ]
  }
];
export default dashRoutes;
